import React from "react";
import SelectBakavd from "../Formular/SelectBakavd";
import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
// import {faPencilAlt, faTrash} from "@fortawesome/free-solid-svg-icons";
import {faTrash} from "@fortawesome/free-solid-svg-icons";

function InneliggandePatienter({
  patienter,
  redigeradPatient,
  setRedigeradPatient,
  sparaRedigering,
  startRedigering,
  deletePatient,
  inAvd,
  setInAvd,
}) {
  return (
    <div>
      <table className="table">
        <thead>
          <tr>
            <th>Plats</th>
            <th>Datum</th>
            <th>Initialer</th>
            <th>FVK</th>
            <th>Bakavdelning</th>
            <th>VÃ¥rdtid</th>
            <th></th>
          </tr>
        </thead>
        <tbody>
          {patienter.map((patient) => (
            <tr key={patient.id}>
              <td>
                {redigeradPatient && redigeradPatient.id === patient.id ? (
                  <input
                    type="text"
                    value={redigeradPatient.plats}
                    onChange={(e) =>
                      setRedigeradPatient({
                        ...redigeradPatient,
                        plats: e.target.value,
                      })
                    }
                  />
                ) : (
                  patient.plats
                )}
              </td>
              <td>{patient.datum}</td>
              <td>{patient.initialer}</td>
              <td>
                {redigeradPatient && redigeradPatient.id === patient.id ? (
                  <input
                    type="text"
                    value={redigeradPatient.fvk}
                    onChange={(e) =>
                      setRedigeradPatient({
                        ...redigeradPatient,
                        fvk: e.target.value,
                      })
                    }
                  />
                ) : (
                  patient.fvk
                )}
              </td>
              <td>
                {redigeradPatient && redigeradPatient.id === patient.id ? (
                  <SelectBakavd
                    setInAvd={setRedigeradPatient}
                    inAvd={redigeradPatient.avd}
                  />
                ) : (
                  patient.avd
                )}
              </td>

              <td>0 - 4 dagar</td>
              <td>
                {redigeradPatient && redigeradPatient.id === patient.id ? (
                  <button onClick={sparaRedigering}>Spara</button>
                ) : (
                  <button onClick={() => startRedigering(patient)}>
                    Redigera
                  </button>
                )}
              </td>

              <td>
                <span style={{color: "red", margin: "3px"}}>
                  <FontAwesomeIcon
                    icon={faTrash}
                    size="lg"
                    onClick={() => deletePatient(patient.id)}
                  />
                </span>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default InneliggandePatienter;
